import React,{ useState } from "react";
import axios from "axios";
import { useNavigate } from 'react-router-dom';

 
function Register() {
 
 const [userName, setUserName] = useState("");
 const [userEmail, setUserEmail] = useState("");
 const [userPassword, setUserPassword] = useState("");
 const navigate = useNavigate();

 
 
 async function save(event) {
 event.preventDefault();
 try {
 await axios.post("http://localhost:8080/registration/save", {
 userName: userName,
 userEmail: userEmail,
 userPassword: userPassword,
 });
 alert("User Registation Successfully");
 navigate('/');
 
 } catch (err) {
 alert(err);
 }
 }
 
 return (
    <div>
        <div className="container mt-4">
            <div class="card">
                <h1>User Registation</h1>
            <form>
                <div class="form-group">
                    <label>User Name</label>
                    <input type="text" class="form-control" id="userName" placeholder="Enter Name" value={userName} onChange={(event)=>{
                        setUserName(event.target.value);
                    }}
                    />
                </div>
                <div class="form-group">
                    <label>User Email</label>
                    <input type="text" class="form-control" id="userEmail" placeholder="Enter Email" value={userEmail} onChange={(event)=>{
                        setUserEmail(event.target.value);
                    }}
                    />
                </div>
                <div class="form-group">
                    <label>User Password</label>
                    <input type="text" class="form-control" id="userPassword" placeholder="Enter Password" value={userPassword} onChange={(event)=>{
                        setUserPassword(event.target.value);
                    }}
                    />
                </div>
                <button type="submit" class="btn btn-primary mt-4" onClick={save}>Save</button>
            </form>
            </div>
        </div>


    </div>
 );
 }
 
 export default Register;
